import React, { Component } from "react";

import image from "../images/plus-circle.svg";
import "../index.css";

class MenuComponent extends React.Component {
  handleClick() {
    console.log("Clicked");
  }

  render() {
    return (
      <div>
        <img src={image} onClick={this.handleClick}></img>
      </div>
    );
  }
}

export default MenuComponent;
